    "EdX doesn't have a timed transcript for this video in Studio, but we found a transcript on YouTube. You can import the YouTube transcript or upload your own .srt transcript file.": "EdX kh\u00f4ng c\u00f3 b\u1ea3n d\u1ecbch \u0111\u1ed3ng b\u1ed9 th\u1eddi gian cho video n\u00e0y trong Studio, nh\u01b0ng ch\u00fang t\u00f4i \u0111\u00e3 t\u00ecm th\u1ea5y m\u1ed9t b\u1ea3n d\u1ecbch tr\u00ean YouTube. B\u1ea1n c\u00f3 th\u1ec3 nh\u1eadp b\u1ea3n d\u1ecbch YouTube ho\u1eb7c t\u1ea3i l\u00ean t\u1ec7p b\u1ea3n d\u1ecbch .srt c\u1ee7a b\u1ea1n.",
    "EdX doesn\\'t have a timed transcript for this video. Please upload an .srt file.": "EdX kh\u00f4ng c\u00f3 b\u1ea3n d\u1ecbch \u0111\u1ed3ng b\u1ed9 th\u1eddi gian cho video n\u00e0y. H\u00e3y t\u1ea3i l\u00ean m\u1ed9t t\u1ec7p .srt.",
    "EdX has a timed transcript for this video. If you want to edit this transcript, you can download, edit, and re-upload the existing transcript. If you want to replace this transcript, upload a new .srt transcript file.": "EdX c\u00f3 b\u1ea3n d\u1ecbch \u0111\u1ed3ng b\u1ed9 th\u1eddi gian cho video n\u00e0y. N\u1ebfu b\u1ea1n mu\u1ed1n ch\u1ec9nh s\u1eeda b\u1ea3n d\u1ecbch n\u00e0y, b\u1ea1n c\u00f3 th\u1ec3 t\u1ea3i xu\u1ed1ng, ch\u1ec9nh s\u1eeda v\u00e0 t\u1ea3i l\u1ea1i b\u1ea3n d\u1ecbch hi\u1ec7n t\u1ea1i. N\u1ebfu b\u1ea1n mu\u1ed1n thay th\u1ebf b\u1ea3n d\u1ecbch n\u00e0y, h\u00e3y t\u1ea3i l\u00ean m\u1ed9t t\u1ec7p .srt m\u1edbi.",
    "EdX has a timed transcript for this video. If you want to replace this transcript, upload a new .srt transcript file. If you want to edit this transcript, you can download, edit, and re-upload the existing transcript.": "EdX c\u00f3 B\u1ea3n d\u1ecbch \u0111\u1ed3ng b\u1ed9 th\u1eddi gian cho video n\u00e0y. N\u1ebfu b\u1ea1n mu\u1ed1n thay th\u1ebf b\u1ea3n d\u1ecbch n\u00e0y, h\u00e3y t\u1ea3i l\u00ean t\u1ec7p b\u1ea3n d\u1ecbch .srt m\u1edbi. N\u1ebfu b\u1ea1n mu\u1ed1n ch\u1ec9nh s\u1eeda b\u1ea3n d\u1ecbch n\u00e0y, b\u1ea1n c\u00f3 th\u1ec3 t\u1ea3i xu\u1ed1ng, ch\u1ec9nh s\u1eeda v\u00e0 t\u1ea3i l\u1ea1i b\u1ea3n d\u1ecbch hi\u1ec7n t\u1ea1i.",
