    "Enable Cohorts": "\u0423\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u043a\u043e\u0433\u043e\u0440\u0442\u0438",
    "Enable Weekly Highlight Emails": "\u0423\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u0429\u043e\u0442\u0438\u0436\u043d\u0435\u0432\u0456 \u041e\u0441\u043d\u043e\u0432\u043d\u0456 \u041f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f ",
