    "Help Translate into {beta_language}": "\u0414\u043e\u043f\u043e\u043c\u043e\u0433\u0430 \u0437 \u043f\u0435\u0440\u0435\u043a\u043b\u0430\u0434\u043e\u043c \u043d\u0430 {beta_language}",
    "Help other learners decide whether to join your team by specifying some characteristics for your team. Choose carefully, because fewer people might be interested in joining your team if it seems too restrictive.": "Gi\u00fap h\u1ecdc vi\u00ean kh\u00e1c quy\u1ebft \u0111\u1ecbnh vi\u1ec7c tham gia nh\u00f3m c\u1ee7a b\u1ea1n b\u1eb1ng c\u00e1ch ch\u1ec9 \u0111\u1ecbnh m\u1ed9t s\u1ed1 \u0111\u1eb7c tr\u01b0ng cho nh\u00f3m c\u1ee7a b\u1ea1n. Ch\u1ecdn m\u1ed9t c\u00e1ch c\u1ea9n th\u1eadn, b\u1edfi v\u00ec \u00edt ng\u01b0\u1eddi c\u00f3 th\u1ec3 quan t\u00e2m \u0111\u1ebfn vi\u1ec7c gia nh\u1eadp nh\u00f3m c\u1ee7a b\u1ea1n n\u1ebfu n\u00f3 c\u00f3 v\u1ebb qu\u00e1 h\u1ea1n ch\u1ebf.",
