    "Hide content after due date": "\u1ea8n n\u1ed9i dung sau ng\u00e0y \u0111\u00e1o h\u1ea1n",
    "Hide entire subsection": "\u1ea8n to\u00e0n b\u1ed9 ph\u1ea7n con",
