    "Hide transcripts ({transcriptCount})": "\u041f\u0440\u0438\u0445\u043e\u0432\u0430\u0442\u0438 \u0442\u0440\u0430\u043d\u0441\u043a\u0440\u0438\u043f\u0442\u0438 ({transcriptCount})",
